import { Link } from "react-router-dom";
import {breadcrumb } from "react-bootstrap";

const Header = () => {
    return (
        <div className="header">
            <Breadcrumb>
            <Link to="/">Home</Link>
            <Link to="/create">Create</Link>
            <Link to="/answer">Answer</Link>
            <Link to="/results">Results</Link>
            </Breadcrumb>
        </div>
    )
}

export default Header;
